                        "Desc": "망토를 휘날리며 그림자 찌르기로 <color style='color:#80FFD7;'>바람 원소 피해</color>를 준다.<br>그림자 찌르기가 적에게 명중 시 리넷은 자신의 HP 최대치를 기반으로 HP를 회복하고, 그 후 4초 동안 1초마다 일정량의 HP를 소모한다.<br>짧은 터치 또는 홀드 시 각각 다른 방식으로 그림자 찌르기를 발동한다.<br><br><color style='color:#FFD780;'>짧은 터치</color><br>신속하게 그림자 찌르기를 펼친다.<br><br><color style='color:#FFD780;'>홀드</color><br>리넷이 「그림자 괴도」 자세로 질주하며 주변의 적에게 「그림자 표식」을 부여한다. 질주 방향은 제어할 수 있고, 스킬을 재발동해 질주 상태를 사전에 종료할 수 있다.<br>질주 종료 시 리넷은 그림자 찌르기를 펼친다. 이때 주변에 그림자 표식을 보유한 적이 있을 경우, 리넷은 그림자 찌르기를 펼치기 전에 해당 적에게 빠르게 접근한다.<br><br>동시에 최대 1명의 적에게만 리넷 자신이 부여한 그림자 표식이 존재할 수 있다. 그림자 표식이 부여된 적과 너무 멀리 떨어질 경우, 해당 표식은 사라진다.<br><br><color style='color:#FFD780;'>아르케의 힘: 우시아</color><br>일정 시간마다 리넷이 그림자 찌르기를 발동 시, 솟구치는 칼날을 소환해 우시아 성질의 <color style='color:#80FFD7;'>바람 원소 피해</color>를 준다.<br><br><i>「이제 무대로 시선을 돌려 공연을 계속 감상해 봐. 난 네가 상상치도 못한 곳에서 다시 등장할 테니까」</i>",
